import React from 'react';
import url from '../api/index.json';


const Answer = () => {

const data  = url.answer;

const response = data.map((item, id)=>{
    return(<p key={id}>{item.ans}</p>)
})

return (
    <div>
        <p>The correct answer is</p>
        {response}
    </div>
)
};

export default Answer;
